---
sq:
  rbnf:
    grouping:
    - :type: SpelloutRules
      :ruleset:
      - :type: spellout-numbering-year
        :rules:
        - :value: x.x
          :rule: "=0.0=;"
        - :value: 0
          :rule: "=%spellout-numbering=;"
      - :type: spellout-numbering
        :rules:
        - :value: 0
          :rule: "=%spellout-cardinal-masculine=;"
      - :type: spellout-cardinal-masculine
        :rules:
        - :value: "-x"
          :rule: minus >>;
        - :value: x.x
          :rule: "<< presje >>;"
        - :value: 0
          :rule: zero;
        - :value: 1
          :rule: një;
        - :value: 2
          :rule: dy;
        - :value: 3
          :rule: tre;
        - :value: 4
          :rule: katër;
        - :value: 5
          :rule: pesë;
