          :rule: gjashtë;
        - :value: 7
          :rule: shtatë;
        - :value: 8
          :rule: tetë;
        - :value: 9
          :rule: nëntë;
        - :value: 10
          :rule: dhjetë;
        - :value: 11
          :rule: ">%spellout-cardinal-masculine>mbëdhjetë;"
        - :value: 20
          :rule: njëzet[ e >>];
